  return (

      <Router>
        <div className="App">
          <Switch path='/'>
            <Header />
            <Home />
          </Switch>
          <Switch path='/checkout'>
            <h1>iN CHECKOUT</h1>
          </Switch>

        </div>
      </Router>



  );
}

export default App;
